          <li className="nav-item mb-2">
            <button className="btn btn-link text-white text-start w-100 p-2" onClick={() => navigate('/admin/cars')}>
              <i className="fas fa-car me-2"></i> Cars
            </button>
          </li>
          <li className="nav-item mb-2">
