                    <th className="px-4 py-3">Pickup Date</th>
                    <th className="px-4 py-3">Return Date</th>
                    <th className="px-4 py-3">Total Price</th>
                    <th className="px-4 py-3">Status</th>
                    <th className="px-4 py-3">Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {filteredBookings.map((booking) => (
                    <tr key={booking.id}>
                      <td className="px-4 py-3">{booking.id}</td>
                      <td className="px-4 py-3">
                        <div>
                          <div>{booking.user}</div>
                          <small className="text-muted">{booking.email}</small>
                        </div>
                      </td>
                      <td className="px-4 py-3">
                        <div>
                          <div>{booking.car}</div>
                          <small className="text-muted">{booking.model}</small>
                        </div>
                      </td>
                      <td className="px-4 py-3">{booking.pickupDate}</td>
                      <td className="px-4 py-3">{booking.returnDate}</td>
                      <td className="px-4 py-3">{booking.totalPrice}</td>
                      <td className="px-4 py-3">
                        <select 
                          className={`form-select form-select-sm ${
                            booking.status === 'Pending' ? 'text-warning' : 
                            booking.status === 'Confirmed' ? 'text-success' : 
                            'text-danger'
                          }`}
                          value={booking.status}
                          onChange={(e) => {
                            // Handle status change
                            const updatedBookings = bookings.map(b => 
                              b.id === booking.id ? { ...b, status: e.target.value } : b
                            );
                            setBookings(updatedBookings);
                            if (activeFilter === 'All') {
                              setFilteredBookings(updatedBookings);
                            } else {
                              setFilteredBookings(updatedBookings.filter(b => b.status === activeFilter));
                            }
                          }}
                        >
                          <option value="Pending">Pending</option>
                          <option value="Confirmed">Confirmed</option>
                          <option value="Cancelled">Cancelled</option>
                        </select>
                      </td>
                      <td className="px-4 py-3">
                        <button className="btn btn-primary btn-sm">
                          <i className="fas fa-edit"></i>
                        </button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

